.footer {
    font-weight: 400;
    font-size: 14px;
    line-height: calc(17 / 14 * 100%);
    margin: 0 0 40px 0;
    &__container{
        background-color: #ffffff;
        justify-content: space-around;
        padding: 0 140px;
    }
    &-up {
        padding: 100px 0;
        display: flex;
        align-content: center;
        &__logo {
            margin-bottom: 20px;
        }
        &__text {
            line-height: calc(24 / 14 * 100%);
            color: rgba(31, 32, 65, 0.5);
            &-right {
                margin-bottom: 20px;
            }
        }
        &__block{
            display: flex;
            flex-direction: column;
            flex: 0 0 260px;
            margin-right: 40px;
        }
        &__nav {
            display: flex;
            flex-direction: row;
            & ul {
                &:first-child {
                    flex: 0 0 143px;
                    margin-right: 57px;
                } 
                &:nth-child(2){
                    flex: 0 0 108px;
                    margin-right: 92px;
                } 
                &:nth-child(3){
                    flex: 0 0 149px;
                    margin-right: 51px;
                } 
             }
        }
        &__item { 
            display: flex;
            flex-direction: column;
            & li {
                margin-bottom: 20px;
                &:first-child {
                    font-weight: 700 ;
                    font-size: 12px;
                    line-height: calc(15 / 12 * 100%);
                    text-transform: uppercase;
                    margin-bottom: 21px;
                    & a {
                        color: #1F2041;
                    }
                }
                &:last-child{
                    margin-bottom: 0;
                }
            }
        }
        &__list {
            color: rgba(31, 32, 65, 0.5);
        }
        &__input {
            border: 1px solid rgba(31, 32, 65, 0.25);
            border-radius: 4px;
            padding: 8px 80px 8px 15px;
        }
        &__arrow {
            position: relative;
            & img {
                position: absolute;
                left: -30px;
                top: 0px;
            }
        }
    }
    &-down {
        display: flex;
        justify-content: space-between;
        align-content: center;
        padding: 26px 0;
            &__title {
                color: rgba(31, 32, 65, 0.75);
            }
            &__icon {
                margin-right: 20px;
                &:last-child {
                    margin-right: 0;
                }
            }
    }
}

